class RequestService {
	constructor(host) {
		this.url = host;
	}

	getUsers() {
		const path = '/users';
		const data = {};
		return this.send_(path, data);
	}

	getGroups() {
		const path = '/groups';
		const data = {};
		return this.send_(path, data);
	}

	createBraid(braid) {
		const path = '/create';
		const data = braid; //TODO: transform into expected API format		
// TODO: url args?
		return this.send_(path, data);
	}

	getBraid(braidId) {
		const path = '/get/' + braidId; // id in path
		const data = {};
		return this.send_(path, data);
	}


	/** @return {!Promise<!Braid>} */
	getAllBraids() {
		const path = '/getAll';
		const data = {};
		return this.send_(path, data);
	}

	send_(path, data, isMutate = false) {
		const settings = {
			data,
		    type: isMutate ? 'POST' : "GET",
  			// dataType: "json",
		    url: "/my/url/",
		    success: function(data){
		        console.log("call to " + path + " succeeded");
		        console.log('result: ' + JSON.stringify(data));
		    },
		    failure: function(data){
		        console.log("call to " + path + " failed");
		        console.log('result: ' + JSON.stringify(data));
		    },
		};

		return jQuery.ajax(this.url+path, settings).then(response => {
			// TODO: process response into Braid objects
			return response.results;
		});
	}

}

